  false,\n\t\"url\": null,\n\t\"notes\": \"This table contains the total number of
  new leases, by state, issued by the BLM during each fiscal year. Leases issued over
  the course of a fiscal year may or may not be leases sold during that same year.
  For example, a lease might have been sold but not issued pending protest resolution.
  Following successful resolution, that lease would have been issued, but this process
  may not have concluded in the same fiscal year. This figure includes parcels sold
  at a competitive lease sale, as well as leases issued non-competitively.\",\n\t\"license_title\":
